description:
Outline planning application (with appearance, landscaping and internal layout to be reserved matters), for partial redevelopment of the Westbury Estate comprising:
- Demolition of 89 existing homes (Use Class C3) and no. 438 Wandsworth Road (Use Class A1) and; 
- Construction of replacement and new homes in eight new blocks (Use Class C3) between 4 and 8 storeys in height, to provide up to 270 residential units, together with new and improved open space and public realm, playspace, vehicular and cycle parking and ancillary works.
